import React from "react";
import { Link } from "react-router-dom";

function Navbar(props) {
    return (
        <nav className="navbar navbar-expand-sm navbar-dark bg-dark">
            <a className="navbar-brand" href="#">Tornado tracker</a>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNav">
                <ul className="navbar-nav">
                <li className="nav-item">
                    <Link to="/"><a className={"nav-link" + (props.page=="Inicio" ? ' active' : '')}>Inicio<span className="sr-only">(current)</span></a></Link>
                </li>
                <li className="nav-item">
                    <Link to="/tornados"><a className="nav-link">Tornados</a></Link>
                </li>
                </ul>
            </div>
        </nav>
    )
}

export default Navbar;
